def score_of_tile(tile):
    if tile < 2:
        return 0
    if tile == 2:
        return 36 / 11
    return 2 * score_of_tile(tile - 1) + 2 ** tile


large_th = 6
for comb in range(0, 2 ** 16, 2 ** large_th):
    binary = bin(comb)[2:]
    print(binary)
    print(comb, end='\n')
